import React from 'react'
import { gr } from '../../data';
import './BlueCard.css'

const BlueCard = () => {
  return (
    <>
    <div className='blue-body'>

   {
       gr.map((cur, index) =>
       <div className='gr-al'>
       <img className="image_gr" src={cur} alt="" key={index.toString()}/>
       </div>
       )
   }



    </div>
    </>
  )
}

export default BlueCard;
